import React from 'react';

class Input extends React.Component{

    render(){
        const { title, value, update } = this.props;
        return <>

               
                <h2>{ title }</h2>

                <input type="number" value={ value } onChange={ event => update(event.target.value)}/>

            </>
    }

}

export default Input
